package de.cdnrelaxo.skyblocksystem.util.npc.skin;

public enum SavedSkins {

    SURVIVAL("", ""),
    BEDWARS("", "");

    final String texture;
    final String signature;

    SavedSkins(String texture, String signature) {
        this.texture = texture;
        this.signature = signature;
    }

    public String getSignature() {
        return signature;
    }

    public String getTexture() {
        return texture;
    }
}
